import Select from "react-select";
import dateIcon from "../assets/img/landingPage/dateIcon.png";


function SelectedYear(){

const years = [2021,2020,2019,2018,2017,2016,2015,2014,2013,2012,2011,2010,2009,2008,2007]
const optionsSector = [
    {
      value: years[0],
      label: (
        <div className="dateOptions">
          <img src={soflis_meurneoba} alt="" className="SeqtorebisIcons" />
          {years[0]}
        </div>
      ),
    },
    {
      value: years[1],
      label: (
        <div className="dateOptions">
          <img src={samtomopovebiti} alt="" className="SeqtorebisIcons" />
          {years[1]}
        </div>
      ),
    },
    {
      value: years[2],
      label: (
        <div className="dateOptions">
          <img src={damamushavebeli} alt="" className="SeqtorebisIcons" />
          {years[2]}
        </div>
      ),
    },
    {
      value: years[3],
      label: (
        <div className="dateOptions">
          <img src={energetika} alt="" className="SeqtorebisIcons" />
          {years[3]}
        </div>
      ),
    },
    {
      value: years[4],
      label: (
        <div className="dateOptions">
          <img src={mshenebloba} alt="" className="SeqtorebisIcons" />
          {years[4]}
        </div>
      ),
    },
    {
      value: years[5],
      label: (
        <div className="dateOptions">
          <img src={sastumroebi} alt="" className="SeqtorebisIcons" />
          {years[5]}
        </div>
      ),
    },
    {
      value: years[6],
      label: (
        <div className="dateOptions">
          <img src={transporti} alt="" className="SeqtorebisIcons" />
          {years[6]}
        </div>
      ),
    },
    {
      value: years[7],
      label: (
        <div className="dateOptions">
          <img src={kavshirgabmuloba} alt="" className="SeqtorebisIcons" />
          {years[7]}
        </div>
      ),
    },
    {
      value: years[8],
      label: (
        <div className="dateOptions">
          <img src={ganatleba} alt="" className="SeqtorebisIcons" />
          {years[8]}
        </div>
      ),
    },
    {
      value: years[9],
      label: (
        <div className="dateOptions">
          <img src={jandacva} alt="" className="SeqtorebisIcons" />
          {years[9]}
        </div>
      ),
    },
    {
      value: years[10],
      label: (
        <div className="dateOptions">
          <img src={jandacva} alt="" className="SeqtorebisIcons" />
          {years[10]}
        </div>
      ),
    },
    {
      value: years[11],
      label: (
        <div className="dateOptions">
          <img src={safinanso} alt="" className="SeqtorebisIcons" />
          {years[11]}
        </div>
      ),
    },
    {
      value: years[12],
      label: (
        <div className="dateOptions">
          <img src={danarcheni} alt="" className="SeqtorebisIcons" />
          {years[12]}
        </div>
      ),
    },
    {
        value: years[13],
        label: (
          <div className="dateOptions">
            <img src={danarcheni} alt="" className="SeqtorebisIcons" />
            {years[12]}
          </div>
        ),
      },
      {
        value: years[14],
        label: (
          <div className="dateOptions">
            <img src={danarcheni} alt="" className="SeqtorebisIcons" />
            {years[12]}
          </div>
        ),
      },
  ];
    return(
    <Select
        name="sector"
        id="sector"
        placeholder="2021"

        styles={customStyles}
        className="chooseCountrySelect"
        options={optionsSector}
        id="years"
style={{
  backgroundImage: `url(${dateIcon})`,
  backgroundRepeat: "no-repeat",
  width: "50%",
  backgroundPosition: "right 6% top 50%",
}}
        onChange={(e)=>Selected(e)}
      />
    )
}
export default SelectedYear
